import React, {Component} from 'react';
import SubTitle from "../SubTitle/SubTitle";
import './AboutEducation.css'
import SliderCard from '../SliderCard/SliderCard'
function AboutEducation(props) {
    const educationTitleText='Психотерапевтична освіта та практичні навички';
    const educationTitleStyle = {
        color:'white',
        'font-weight': '900',
        padding: '30px 0 30px 0'
    };
        return (
            <div className="about-education-section">
                <div className="container">
                    <SubTitle style={educationTitleStyle} text={educationTitleText}/>
                    <div className="about-education__inner">
                        <Slider {...settings}>
                            <SliderCard title={"Shaverma Bro"} text={"Інтернет-магазин ресторану Шаверма Бро"}/>
                            <SliderCard title={"Petsfield"} text={"Монети для Fifa за найнижчими цінам лише на DimasCoin"}/>
                            <SliderCard title={"Психолог Марія"} text={"Послуги професійного психолога Марії Шугай"}/>
                            <SliderCard title={"Dimas Coin"} text={"Монети для Fifa за найнижчими цінам лише на DimasCoin"}/>
                            <SliderCard title={"Rem Kuzov Chasti"} text={"Купуйте автомобільні деталі на Rem Kuzov Chasti"}/>
                        </Slider>
                    </div>
                </div>
            </div>
        );
}

export default AboutEducation;
